import React, {Component} from 'react'
import './style.css'

class Bom extends Component{
  render(){
    return (
      <div className="bom">
        <div className="left">2 items left</div>
        <div className="center">
          <span>All</span>
          <span>Active</span>
          <span>Complated</span>
        </div>
        <div className="right">Clear Complated</div>
      </div>
    )
  }
}

export default Bom
